import React from 'react'
import '../style/style.css'

function KeyBoard() {
    const KeyBoard = [
        [1,2,3],
        [4,5,6],
        [7,8,9]
    ]

    return (
    <div className='keyboard'>
        {
            KeyBoard.forEach( row =>{
                <div className='row-container'>
               {
                    row.forEach( key =>{
                            <span className='keyboard--key'>{key}</span>                    
                        })
                    }
             </div>
           })
        }
    </div>
  )
}

export default KeyBoard
